import React from 'react';
import { Link } from 'react-router-dom';

// https://react-icons.netlify.com/#/
import { AiTwotoneHome } from 'react-icons/ai';
import { FaSmile } from 'react-icons/fa';
import { FaPills } from 'react-icons/fa';
import { FaUserAlt } from 'react-icons/fa';

import { Container, Row, Col } from 'react-bootstrap';
import '../../styles/css/layout/navigation.css';

class Navbar extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {

        return (
            <Container className="Navbar" fixed="bottom">
                <Row>
                    <Col>hi</Col>
                    <Col>hi</Col>
                    <Col><Link to="/home"><AiTwotoneHome className="NavIcon" /></Link></Col>
                    <Col><Link to="/mood-list"><FaSmile className="NavIcon" /></Link></Col>
                    <Col><Link to="/med-list"><FaPills className="NavIcon" /></Link></Col>
                    <Col><Link to="/profile"><FaUserAlt className="NavIcon" /></Link></Col>
                </Row>
            </Container>
        );

    }
};

export default Navbar;
